import React, { useState, useEffect } from 'react';
import { FaHome, FaSearch, FaHeart, FaUser, FaBars, FaTimes } from 'react-icons/fa';
import '../styles/Navbar.css';

const Navbar = () => {
  const [scrolled, setScrolled] = useState(false);
  const [menuOpen, setMenuOpen] = useState(false);

  // Handle scroll effect for navbar
  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 50) {
        setScrolled(true);
      } else {
        setScrolled(false);
      }
    };

    window.addEventListener('scroll', handleScroll);

    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  // Toggle mobile menu
  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <nav className={`navbar ${scrolled ? 'scrolled' : ''}`}>
      <div className="navbar-container">
        {/* Logo */}
        <div className="logo">
          <FaHome className="logo-icon" />
          <span className="logo-text">SwissEstate</span>
        </div>

        {/* Desktop Navigation */}
        <ul className="nav-links">
          <li className="nav-item active">
            <a href="/">Home</a>
          </li>
          <li className="nav-item">
            <a href="/buy">Buy</a>
          </li>
          <li className="nav-item">
            <a href="/rent">Rent</a>
          </li>
          <li className="nav-item">
            <a href="/sell">Sell</a>
          </li>
          <li className="nav-item">
            <a href="/agents">Agents</a>
          </li>
          <li className="nav-item">
            <a href="/about">About</a>
          </li>
        </ul>

        {/* User Actions */}
        <div className="user-actions">
          <button className="action-button">
            <FaSearch />
          </button>
          <button className="action-button">
            <FaHeart />
            <span className="notification">2</span>
          </button>
          <button className="action-button user">
            <FaUser />
          </button>
          <button className="contact-button">Contact</button>
        </div>

        {/* Mobile Menu Button */}
        <div className="mobile-menu-button" onClick={toggleMenu}>
          {menuOpen ? <FaTimes /> : <FaBars />}
        </div>
      </div>

      {/* Mobile Menu */}
      <div className={`mobile-menu ${menuOpen ? 'active' : ''}`}>
        <ul className="mobile-nav-links">
          <li className="mobile-nav-item active">
            <a href="/" onClick={toggleMenu}>Home</a>
          </li>
          <li className="mobile-nav-item">
            <a href="/buy" onClick={toggleMenu}>Buy</a>
          </li>
          <li className="mobile-nav-item">
            <a href="/rent" onClick={toggleMenu}>Rent</a>
          </li>
          <li className="mobile-nav-item">
            <a href="/sell" onClick={toggleMenu}>Sell</a>
          </li>
          <li className="mobile-nav-item">
            <a href="/agents" onClick={toggleMenu}>Agents</a>
          </li>
          <li className="mobile-nav-item">
            <a href="/about" onClick={toggleMenu}>About</a>
          </li>
          <li className="mobile-nav-item">
            <a href="/contact" onClick={toggleMenu}>Contact</a>
          </li>
        </ul>

        <div className="mobile-user-actions">
          <button className="mobile-action-button">
            <FaSearch /> Search
          </button>
          <button className="mobile-action-button">
            <FaHeart /> Favorites
          </button>
          <button className="mobile-action-button">
            <FaUser /> My Account
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
